import './Footer.css';
import logo from '../../../images/logos/logo-desktop-white.svg';
import instagram from '../../../images/social/social-insta-tan.svg';
import linkedin from '../../../images/social/social-linkedin-tan.svg';
import twitter from '../../../images/social/social-twitter-tan.svg';


import { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';



function Footer() {
  const [config, setConfig] = useState({});


  return (
    <div className="footer">
      <Container>
        <Row>
          <Col xs={12} md={5} className="d-flex">
            <div className="footer__nav--left">
              <Link to="/solutions/inputs" className="primary-neutral footer__nav-item">Solutions</Link>
              <Link to="/partners" className="primary-neutral footer__nav-item">Partners</Link>
              {config.isFaqEnabled &&
                <Link to="/faq" className="primary-neutral footer__nav-item">FAQ</Link>
              }
            </div>
            <div>
              <Link to="/about" className="primary-neutral footer__nav-item">About</Link>
              <Link to="/media" className="primary-neutral footer__nav-item">Media</Link>
              <a href="https://ca.indeed.com/cmp/Erthos-Inc./jobs" className="primary-neutral footer__nav-item">Careers</a>
              <Link to="/contact" className="primary-neutral footer__nav-item">Contact Us</Link>
            </div>
          </Col>

          <Col xs={12} md={7} className="footer--right">
            <img src={logo} alt="Eco-Packers logo" />

            <div className="footer__social">
              <a href="https://twitter.com/planeterthos/">
                <img src={twitter} alt="Twitter logo" />
              </a>
              <a href="https://www.linkedin.com/company/erthosinc">
                <img src={linkedin} alt="Linkedin logo" />
              </a>
              <a href="https://www.instagram.com/planeterthos/">
                <img src={instagram} alt="Instagram logo" />
              </a>
            </div>

            <div>
              <span className="footer__footnotes" style={{ marginRight: 20 }}>erthos&trade; &copy; 2020. All Rights Reserved</span>
              <Link to="/terms" className="footer__footnotes" style={{ marginRight: 20 }}>Terms & Conditions</Link>
              <Link to="/privacy" className="footer__footnotes mb-0">Privacy Policy</Link>
            </div>

          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default Footer;
